import React from 'react';
import { StyleSheet, Text, Image, TouchableOpacity, View,ScrollView,Button} from 'react-native';
import AntDesign from 'react-native-vector-icons/AntDesign';
import MaterialIcons from 'react-native-vector-icons/MaterialIcons';
import Calling from '../../components/calling';
import OurData from '../../components/ourdata';
import OurButton from '../../components/GoToButton';
import ModuleButton from '../../components/moduleButton';

//import styles from './styles.js';
const Homesearch = ({navigation}) => {
   
    const pressHandler =() =>{
        navigation.navigate('destination');
        
    }
    return(
        <ScrollView>
        <View>
             <Image 
            style= {styles.Image}
            source={require( '../../assets/HealthWetu.png' )}
            />
        {/* input bot */}
        
        
        <OurButton text='Where are you ' onPress={pressHandler}/>
        <ModuleButton text = 'calling for a friendss '/>
        <OurData/>

   </View>
   </ScrollView>
    )
}
const styles = StyleSheet.create({
  
    inputText:{
        fontSize:20,
        fontWeight:'600',
        color:'#6e6e6e',


        
    },
    Image:{
        
        paddingTop:20,
        margin:50,
        height:350,
        width:'auto',
    },
    Timebar:{
        flexDirection:'row',
        justifyContent:'space-between',
        width:35,
        padding:10,
        backgroundColor:'#fff',
        borderRadius:50,
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 2,
        },
        shadowOpacity: 0.25,
        shadowRadius: 4.84,

        elevation: 5,

    },
    inputBox:{
        backgroundColor:'#fff',
        margin:10,
        padding:10,
        flexDirection:'row',
        justifyContent: 'space-between',
        alignItems:'center',
        borderRadius:10,
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 2,
        },
        shadowOpacity: 0.25,
        shadowRadius: 4.84,

        elevation: 5,
    },

  });

export default Homesearch;
